	specialCharacters := `\/"[]:|<>+=;,?*@&~!#$%^()_{}'`
	if strings.ContainsAny(v, specialCharacters) {
		errors = append(errors, fmt.Errorf("%q cannot contain the special characters: `%s`", k, specialCharacters))
	}

	return warnings, errors
}

